import React from 'react';
import { StyleSheet, Text, View } from 'react-native';



const App = () => {
    return (
        <View style={styles.container}>
            <Text style={styles.text}>Star Wars</Text>
        </View>
    );
}

export default App;

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: 'red',
        justifyContent: 'center',
        alignItems: 'center'
    },
    text: {
        color: 'white'
    }
});
